        //         <Route
        //             path="*"
        //             element={<Login />}
        //         />
        //     </Routes>
        //     :
        //     <Routes>
        //         <Route path={routeNames.LOGIN} element={<Login />} />
        //         <Route
        //             path="*"
        //             element={<Tasks />}
        //         />
        //     </Routes>
    );
};

export default AppRouter;
